import React, { Component } from "react";
import e from "express";

class Rank extends Component {
  state = {
    platform: "psn",
    profile: "Lil_Kha1998",
    segmentType: "legend",
    data: {},
  };
  onChange = (e) => {
    e.target.value = e.target;
  };
  onSubmit = () => {
    fetch(
      `http://localhost:5000/api/v1/profile/${this.state.platform}/${this.state.profile}}`
    )
      .then((res) => res.json())
      .then((res) =>
        this.setState({
          data: res.data.data[0].platformInfo,
        })
      );
  };

  render() {
    return (
      <div className="rank-wrapper">
        <div className="rank-content">
          <form onSubmit={onSubmit}>
            <input onChange={onChange} type="text"></input>
            <button>Submit</button>
          </form>
          <h1>Rank</h1>
          <div className="ranked-output">
            
          </div>
        </div>
      </div>
    );
  }
}

export default Rank;
